window.bookSummaryJSON = "<p><i>Discover the class you were born to play. </i></p> <p>Wren, a seasoned healer, is dismayed when Somnia Online automatically assigns her character, Murmur, to the Enchanter class. Determined to overcome the unexpected setback, she assembles her guild, intent on the coveted number-one spot. Twelve keys stand between her and victory, but finding them is only part of the puzzle.&nbsp;</p> <p>Armed with telepathic abilities, Murmur rises to the challenge. However, old rivals have followed her to Somnia Online desperate for revenge. Intricate quest lines become more dangerous as NPCs absorb powerful artifacts, and Murmur begins to wonder just what sort of AI controls the world.&nbsp;</p> <p>Murmur questions her sanity as the real and virtual worlds mesh together. Everyone is keeping secrets from her, even the AI, and Murmurâ€™s determined to uncover them.</p>"; 
